DROP TABLE AUDITORIA;
DROP TABLE TIPO_AUDITORIA;
DROP TABLE ROLES_X_USUARIO;
DROP TABLE USUARIO;
DROP TABLE DETALLE_MASTER;

/********************************************
  Creacion de las tablas de la Base de Datos
********************************************/
CREATE TABLE DETALLE_MASTER
  (
    ID BIGINT (10) NOT NULL AUTO_INCREMENT,
    NOMBRE VARCHAR(100) NOT NULL,
    ABREVIACION	VARCHAR(50) NOT NULL,
    DESCRIPCION	VARCHAR(200) NOT NULL,
    ID_TIPO	BIGINT (10),
    HABILITADO TINYINT(1) NOT NULL,
    constraint PK_ID PRIMARY KEY(ID),
    constraint FK_DET FOREIGN KEY (ID_TIPO) REFERENCES DETALLE_MASTER (ID)
  );
  
  CREATE TABLE USUARIO
  (
    ID BIGINT (10) NOT NULL AUTO_INCREMENT,
    USUARIO_EMPRESARIAL VARCHAR(50) NOT NULL,
    NRO_IDENTIFICACION BIGINT (20) NOT NULL,
    ID_TIPO_IDENTIFICACION BIGINT (10) NOT NULL,
    PRIMER_NOMBRE VARCHAR(50) NOT NULL,
    SEGUNDO_NOMBRE VARCHAR(50) NULL,
    PRIMER_APELLIDO VARCHAR(50) NOT NULL,
    SEGUNDO_APELLIDO VARCHAR(50) NULL,
    EMAIL VARCHAR(50) NOT NULL,
    TELEFONO VARCHAR(50) NOT NULL,
    CONTRASENA VARCHAR(200) NOT NULL,
    HABILITADO TINYINT(1) NOT NULL,
    constraint   PK_USUARIO PRIMARY KEY(ID),
    constraint   FK_TIPO_IDENTI FOREIGN KEY (ID_TIPO_IDENTIFICACION) REFERENCES DETALLE_MASTER(ID),
    constraint   UQ_USUARIO UNIQUE (USUARIO_EMPRESARIAL)
  );

  CREATE TABLE ROLES_X_USUARIO
  (
    ID BIGINT (10) NOT NULL AUTO_INCREMENT,
    ID_USUARIO BIGINT (10) NOT NULL,
    ID_ROL BIGINT (10) NOT NULL,
    HABILITADO TINYINT(1) NOT NULL,
    constraint   PK_ROL_USER PRIMARY KEY(ID),
    constraint   FK_EMP FOREIGN KEY (ID_USUARIO) REFERENCES DETALLE_MASTER (ID),
    constraint   FK_ROL FOREIGN KEY (ID_ROL) REFERENCES DETALLE_MASTER (ID)
  );

  CREATE TABLE TIPO_AUDITORIA
  (
    ID BIGINT (10) NOT NULL AUTO_INCREMENT,
    NOMBRE VARCHAR(100) NOT NULL,
    DESCRIPCION VARCHAR(1000),
    HABILITADO TINYINT(1) NOT NULL,
    constraint   PK_TIPO_AUDITORIA PRIMARY KEY(ID)
  );


  CREATE TABLE AUDITORIA
  (
    ID BIGINT (10) NOT NULL AUTO_INCREMENT,
    ID_TIPO_AUDITORIA BIGINT (10) NOT NULL,
    IP_MAQUINA	VARCHAR(100) NOT NULL,
    FECHA	DATE NOT NULL,
    ID_USUARIO_AUDITADO	BIGINT (10) NOT NULL,
    OBSERVACION VARCHAR(4000),
    constraint   PK_AUDITORIA PRIMARY KEY(ID),
    constraint FK_TIPO_AUDI FOREIGN KEY (ID_TIPO_AUDITORIA) REFERENCES TIPO_AUDITORIA(ID),
    constraint FK_USUARIO FOREIGN KEY (ID_USUARIO_AUDITADO) REFERENCES USUARIO(ID)
  );



CREATE TABLE LUGARES_GEOGRAFICOS
  (
    ID BIGINT(10) NOT NULL AUTO_INCREMENT,
    DESCRIPCION VARCHAR(100) NOT NULL,
    TIPO_LUGAR VARCHAR(10) NOT NULL,
    CODIGO_DANE BIGINT (10) NOT NULL,
    ID_DANE_PADRE BIGINT (10) NULL,    
    HABILITADO TINYINT(1) NOT NULL,
    constraint PK_LUGARES_GEOGRAFICOS PRIMARY KEY(ID)
  );

CREATE TABLE BARRIOS
  (
    ID BIGINT(10) NOT NULL AUTO_INCREMENT,
    NOMBRE VARCHAR(100) NOT NULL,    
    CODIGO_DANE_MPIO BIGINT (10) NOT NULL,
    NOMBRE_MPIO VARCHAR(100) NOT NULL,    
    HABILITADO TINYINT(1) NOT NULL,
    constraint PK_BARRIOS PRIMARY KEY(ID)
  );



  CREATE TABLE CODIGO_ACCESO
  (
    ID BIGINT(10) NOT NULL AUTO_INCREMENT,
    CODIGO VARCHAR(100) NOT NULL UNIQUE,
    FECHA_INICIO DATETIME NOT NULL,
    FECHA_FIN DATETIME NOT NULL,
    EMAIL_ASOCIADO VARCHAR(200),
    CELULAR_ASOCIADO VARCHAR(50),
    CANTIDAD_REGISTROS BIGINT(10) NOT NULL,
    IMAGEN VARCHAR(300),
    HABILITADO  TINYINT(1) NOT NULL,
    USUARIO_CREACION VARCHAR(100) NOT NULL,
    MAQUINA_CREACION VARCHAR(100) NOT NULL,
    FECHA_CREACION	DATE,
    constraint PK_COD_ACCESS PRIMARY KEY(ID)
  );

  
  
 CREATE TABLE SOLICITUD_PRESTAMO
  (
    ID BIGINT(10) NOT NULL,
    P_NOMBRE_SOLICITANTE VARCHAR(20) NOT NULL,
    S_NOMBRE_SOLICITANTE   VARCHAR(20),
    P_APELLIDO_SOLICITANTE   VARCHAR(20) NOT NULL,
    S_APELLIDO_SOLICITANTE   VARCHAR(20),
    TIPO_IDENTIFICACION BIGINT(10) NOT NULL,
    NUMERO_IDENTIFICACION BIGINT(10) NOT NULL,
    ID_DEPTO_RESIDENCIA BIGINT(10) NOT NULL,
    ID_MPIO_RESIDENCIA BIGINT(10) NOT NULL,
    ID_BARRIO_RESIDENCIA BIGINT(10) NOT NULL,
    DIRECCION_RESIDENCIA   VARCHAR(400) NOT NULL,
    ID_GENERO BIGINT(10) NOT NULL,
    EMAIL VARCHAR(50) NOT NULL,
    CELULAR VARCHAR(50) NOT NULL,
    CODIGO_ACCESO   VARCHAR(100),
    HABILITADO  TINYINT(1) NOT NULL,
    USUARIO_CREACION   VARCHAR(100) NOT NULL,
    MAQUINA_CREACION   VARCHAR(100) NOT NULL,
    FECHA_CREACION	DATE NOT NULL,
    constraint PK_SOLICITUD_PRESTAMO PRIMARY KEY(ID),
    constraint FK_TIPO_DOC FOREIGN KEY (TIPO_IDENTIFICACION) REFERENCES DETALLE_MASTER(ID),
    constraint FK_DEPTO FOREIGN KEY (ID_DEPTO_RESIDENCIA) REFERENCES LUGARES_GEOGRAFICOS(ID),
    constraint FK_MPIO FOREIGN KEY (ID_MPIO_RESIDENCIA) REFERENCES LUGARES_GEOGRAFICOS(ID),
    constraint FK_BARRIO FOREIGN KEY (ID_BARRIO_RESIDENCIA) REFERENCES BARRIOS(ID),
    constraint FK_GENERO FOREIGN KEY (ID_GENERO) REFERENCES DETALLE_MASTER (ID),
    constraint FK_COD_ACCESO FOREIGN KEY (CODIGO_ACCESO) REFERENCES CODIGO_ACCESO (CODIGO)
  );



CREATE TABLE DOCUMENTOS
  (
    ID BIGINT(10) NOT NULL AUTO_INCREMENT,
    NOMBRE VARCHAR(100) NOT NULL,
    DESCRIPCION VARCHAR(100) NOT NULL,
    PESO_MAXIMO BIGINT(10) NOT NULL,
    HABILITADO  TINYINT(1) NOT NULL,   
    constraint PK_DOC PRIMARY KEY(ID)
  );


CREATE TABLE DOCUMENTOS_REQUERIDOS
  (
    ID BIGINT(10) NOT NULL AUTO_INCREMENT,
    ID_DOCUMENTO BIGINT(10) NOT NULL,    
    constraint PK_REQ_DOC PRIMARY KEY(ID),
    constraint FK_DOC_REC FOREIGN KEY (ID_DOCUMENTO) REFERENCES DOCUMENTOS(ID)
  );
 

  CREATE TABLE DOCUMENTOS_X_SOLICITUD
  (
    ID BIGINT(10) NOT NULL AUTO_INCREMENT,
    ID_SOLICITUD BIGINT(10) NOT NULL,
    ID_DOCUMENTO BIGINT(10) NOT NULL,
    CONTENIDO_DOC LONGBLOB NOT NULL,
    FORMATO VARCHAR(50) NOT NULL,
    FECHA_CREACION DATETIME DEFAULT CURRENT_TIMESTAMP,
    FECHA_MODIFICACION DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,    
    HABILITADO  TINYINT(1) NOT NULL,
    constraint PK_DOC_SOLIC PRIMARY KEY(ID),   
    constraint FK_DOCUMENTO FOREIGN KEY (ID_DOCUMENTO) REFERENCES DOCUMENTOS(ID)
  );
  

ALTER TABLE CODIGO_ACCESO
MODIFY COLUMN FECHA_INICIO DATETIME;

ALTER TABLE CODIGO_ACCESO
MODIFY COLUMN FECHA_FIN DATETIME;

  COMMIT;

